const puppeteer = require("puppeteer");
const path = require("path");
const fs = require("fs");


async function generateReceiptPDF(data) {
  // Đảm bảo thư mục receipts tồn tại
  const receiptsDir = path.join(__dirname, "../receipts");
  if (!fs.existsSync(receiptsDir)) {
    fs.mkdirSync(receiptsDir, { recursive: true });
  }

  const filePath = path.join(receiptsDir, `${data.paymentCode} - Biên nhận thanh toán Giải đấu Chem - Open 2025.pdf`);

  const browser = await puppeteer.launch({ headless: "new" });
  const page = await browser.newPage();

  const htmlContent = `
  <html>
  <head>
    <meta charset="UTF-8" />
    <style>
  body {
    font-family: "Segoe UI", sans-serif;
    font-size: 14px;
    color: #333;
    margin: 0;
    padding: 40px;
    background-color: #ffffff;
    background-repeat: no-repeat;
    background-position: center center;
    background-size: cover;
  }

  .header {
    text-align: center;
    margin-bottom: 30px;
  }

  .logo {
    width: 100%;
    margin-bottom: 10px;
  }

  h1 {
    font-size: 27px;
    color: #000;
    margin: 0;
    line-height: 1.4;
  }

  .receipt-box {
    background: #fff;
    border: 1px solid #ccc;
    border-radius: 6px;
    max-width: 520px;
    padding: 25px 35px;
    margin: auto;
    box-shadow: 0 0 12px rgba(0,0,0,0.1);
    line-height: 1.7;
  }

  .field {
    margin-bottom: 10px;
  }

  .field strong {
    color: #0055cc;
  }

  .footer {
    text-align: center;
    font-style: italic;
    font-size: 13px;
    color: #000;
    margin-top: 10px;
  }
</style>
  </head>
  <body>
    <div class="header">
      <img src="data:image/png;base64," class="logo" alt="CHEMOPEN" />
      <h1>BIÊN NHẬN ĐĂNG KÝ GIẢI CẦU LÔNG<br />CHEM-OPEN 2025</h1>
    </div>

    <div class="receipt-box">
  <div class="field">Họ tên: <strong>${data.fullName}</strong></div>
  <div class="field">MSSV: <strong>${data.mssv}</strong></div>
  <div class="field">Email: <strong>${data.email}</strong></div>
  <div class="field">SĐT: <strong>${data.phone}</strong></div>
  <div class="field">Nội dung thi đấu: <strong>${data.noidung.join(" + ")}</strong></div>
  <div class="field">Phí đã thanh toán: <strong>${data.amount.toLocaleString("vi-VN")}₫</strong></div>
  <div class="field">Mã thanh toán: <strong>${data.paymentCode}</strong></div>
  <div class="field">Ngày đăng ký: <strong>${new Date().toLocaleDateString("vi-VN")}</strong></div>
  <div class="field">Trạng thái: <strong>Đã thanh toán</strong></div>
</div>

    <div class="footer">
      Biên nhận được tạo tự động sau khi thanh toán thành công.<br />
      Vui lòng lưu lại để đối chiếu khi cần.
    </div>
  </body>
</html>
  `;

  await page.setContent(htmlContent, { waitUntil:["domcontentloaded", "networkidle0"]});

   await page.pdf({
  path: filePath,
  width: "614px",
  height: "874px",
  printBackground: true
});


  await browser.close();
  return filePath;
}

module.exports = generateReceiptPDF;
